import 'package:flutter/material.dart';
import 'package:flutter/cupertino.dart';
import 'package:google_fonts/google_fonts.dart';


void main() {
  runApp(const MyApp());
}

class MyApp extends StatelessWidget {
  const MyApp({super.key});

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      debugShowCheckedModeBanner: false,
      title: 'Flutter Demo',
      theme: ThemeData(

        primarySwatch: Colors.blue,
      ),
      home: Home(),
    );
  }
}

class Home extends StatelessWidget {
  Home({Key? key}) : super(key: key);

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        centerTitle: true,
        title: Text('Fruits Shop',
          style: GoogleFonts.arbutusSlab(
            textStyle: TextStyle(
              color: Colors.white,
              fontSize: 25,
            ),
          ),
        ),
      ),
      body: Scrollbar(
        thickness: 15,
        radius: Radius.circular(15),
        thumbVisibility: true,
        child: ListView.separated(
          itemCount: students.length,
          addAutomaticKeepAlives: true,
          scrollDirection: Axis.vertical,
          itemBuilder: (context, index) {
            return ListTile(

              trailing: Icon(Icons.edit),
              title: Text('${students[index]['title']}',
                style: GoogleFonts.arbutusSlab(
                textStyle: TextStyle(

                color: Colors.black87,
                fontSize: 15,
              ),
            ),
              ),
              subtitle: Text("${students[index]['Price']}",
            style: GoogleFonts.arbutusSlab(
            textStyle: TextStyle(
            fontStyle: FontStyle.italic,
            color: Colors.black87,
            fontSize: 15,
            ),
            ),
              ),
              leading: CircleAvatar(
                backgroundImage: NetworkImage('${students[index]['image']}'),
              ),

           onTap: (){
                Navigator.push(context,
                   MaterialPageRoute(builder: (context) => ContactUs(
                    msg:  students[index]['title'],
                     img:  students[index]['image'],
                     Ps: students[index]['Price'],
                   ),
                   ),
               );
                },

            );
          },
          separatorBuilder: (context, index) {
            return Divider(
              thickness: 2,
              height: 30,
              color: Colors.deepOrange,
            );
          },
        ),
      ),
    );
  }
}
class ContactUs extends StatelessWidget {
  final  String? msg;
  final  String? img;
  final  String? Ps;

  ContactUs({required this.msg, required this.img ,required this.Ps});

  MySnackBar(message, context) {
    return ScaffoldMessenger.of(context)
        .showSnackBar(SnackBar(content: Text(message)));
  }

  MyAlertDialog(context) {
    return showDialog(
        context: context,
        builder: (BuildContext context) {
          return Expanded(
              child: AlertDialog(
                title: Text("Alert !"),
                content: Text("Do you want?"),
                actions: [
                  TextButton(
                      onPressed: () {
                        MySnackBar("Add Card", context);
                        Navigator.of(context).pop();
                      },
                      child: Text("Yes")),
                  TextButton(
                      onPressed: () {
                        MySnackBar("Thanks", context);
                        Navigator.of(context).pop();
                      },
                      child: Text("No")),
                ],
              ));
        });
  }

  ButtonStyle buttonStyle=ElevatedButton.styleFrom(
      padding: EdgeInsets.all(20),

      backgroundColor: Colors.green,
      foregroundColor: Colors.white,
      shape: RoundedRectangleBorder(
          borderRadius: BorderRadius.all(Radius.circular(10))
      )
  );

  @override
  Widget build(BuildContext context) {


    return Scaffold(
     // backgroundColor: Colors.black,
      appBar: AppBar(
        title: Text('$msg',
          style: GoogleFonts.arbutusSlab(
            textStyle: TextStyle(
              color: Colors.black87,
              fontSize: 15,
            ),
          ),
        ),
        centerTitle: true,
      ),
      body: Center(
           child: Padding(
             padding: const EdgeInsets.all(8.0),
             child: Column(

             mainAxisAlignment: MainAxisAlignment.center,
               children: [
                 Text("Fruit Name:$msg",
                   style: GoogleFonts.arbutusSlab(
                     textStyle: TextStyle(
                       fontStyle: FontStyle.italic,
                       color: Colors.black87,
                       fontSize: 15,
                     ),
                   ),
                 ),
                 Container(
                     margin: EdgeInsets.all(10),
                     width: 300,
                     height: 300,
                     color:Colors.cyan ,
                     child: Image(
                         image : NetworkImage('$img')),
                 ),
                 Text("Price:$Ps",
                   style: GoogleFonts.arbutusSlab(
                     textStyle: TextStyle(
                       fontStyle: FontStyle.italic,
                       color: Colors.black87,
                       fontSize: 15,
                     ),
                   ),
                 ),
                 Row(
                   mainAxisAlignment: MainAxisAlignment.center,
                   children: [

                     ElevatedButton(onPressed: (){MyAlertDialog(context);}, child: Text('Buy Now'),style: buttonStyle,),
                     SizedBox(width: 10,),
                     OutlinedButton(onPressed: (){MyAlertDialog(context);}, child: Text('Add Card'),style: buttonStyle,),


                   ],
                 ),

                 Text("My company fruits app provides information about various fruits and their characteristics, such as type, taste, nutrition, and benefits. Users can search for and learn about different fruits, and save their favorite fruits for easy reference.",
                     style: GoogleFonts.arbutusSlab(
                   textStyle: TextStyle(
                   fontStyle: FontStyle.italic,
                   color: Colors.purpleAccent,
                   fontSize: 16,
                 ),
           ),
                 ),
               ],

             ),
           ),
      ),


    );
  }
}
